firmwareUpdateState.description:
State of firmware update:
"NoData" - device sent no update; 
"Pending" - data changes were made, waiting for device response; 
"SendingParts" - sending update parts; 
"Installing" - installing; 
"Finished" - update completed; 
"Canceled" - update was canceled;

